// Order.js
import React from "react";

function Order() {
  return (
    <div style={styles.container}>
      <h1 style={{ ...styles.text, marginTop: "1rem" }}>Online Orders are Under Construction.</h1>
      <h2 style={{ ...styles.text, marginBottom: "1rem" }}>Please come back soon...</h2>
    </div>
  );
}

const styles = {
  container: {
    minHeight: "100vh",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "#fff",
  },
  text: {
    fontSize: "1.8rem",
    color: "#444",
    fontStyle: "italic",
  },
};

export default Order;
